import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const TeamSection = styled.section`
  padding: 120px 0;
  background-color: #151515;
`;

const Container = styled.div`
  max-width: 1440px;
  margin: 0 auto;
  padding: 0 40px;
  
  @media (max-width: 768px) {
    padding: 0 24px;
  }
`;

const SectionHeader = styled.div`
  text-align: center;
  margin-bottom: 80px;
`;

const Title = styled(motion.h2)`
  font-size: 40px;
  font-weight: 600;
  color: #FFFFFF;
  margin-bottom: 24px;
  letter-spacing: -0.01em;
  
  @media (max-width: 768px) {
    font-size: 28px;
  }
`;

const TeamGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(280px, 1fr));
  gap: 40px;
  
  @media (max-width: 768px) {
    gap: 32px;
  }
`;

const TeamCard = styled(motion.div)`
  background: #2A2A2A;
  border: 1px solid #3A3A3A;
  padding: 40px 32px;
  text-align: center;
  transition: all 0.3s ease;
  
  &:hover {
    border-color: #BFBFBF;
    transform: translateY(-4px);
  }
`;

const TeamPhoto = styled.div`
  width: 120px;
  height: 120px;
  background: linear-gradient(135deg, #3A3A3A 0%, #2A2A2A 100%);
  border-radius: 50%;
  margin: 0 auto 24px;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 48px;
  color: #BFBFBF;
  border: 2px solid #3A3A3A;
`;

const TeamName = styled.h3`
  font-size: 24px;
  font-weight: 600;
  color: #FFFFFF;
  margin-bottom: 8px;
`;

const TeamRole = styled.div`
  font-size: 16px;
  color: #3A5AFF;
  font-weight: 500;
  margin-bottom: 16px;
`;

const TeamQuote = styled.p`
  font-size: 14px;
  color: #E0E0E0;
  font-weight: 300;
  line-height: 1.5;
  font-style: italic;
  
  &::before {
    content: '"';
    color: #3A5AFF;
  }
  
  &::after {
    content: '"';
    color: #3A5AFF;
  }
`;

const Team = () => {
  const teamMembers = [
    {
      id: 1,
      name: '–ê–Ω–Ω–∞',
      role: '–ê—Ä—Ç-–¥–∏—Ä–µ–∫—Ç–æ—Ä',
      quote: '–î–∏–∑–∞–π–Ω ‚Äî —ç—Ç–æ —è–∑—ã–∫, –Ω–∞ –∫–æ—Ç–æ—Ä–æ–º –≥–æ–≤–æ—Ä–∏—Ç –ø—Ä–æ–¥—É–∫—Ç',
      avatar: 'üë©‚Äçüé®'
    },
    {
      id: 2,
      name: '–ò–≤–∞–Ω',
      role: '–¢–µ—Ö–Ω–∏—á–µ—Å–∫–∏–π –¥–∏—Ä–µ–∫—Ç–æ—Ä',
      quote: '–ö–æ–¥ –¥–æ–ª–∂–µ–Ω –±—ã—Ç—å —ç–ª–µ–≥–∞–Ω—Ç–Ω—ã–º, –∫–∞–∫ —Ö–æ—Ä–æ—à–∞—è –∞—Ä—Ö–∏—Ç–µ–∫—Ç—É—Ä–∞',
      avatar: 'üë®‚Äçüíª'
    },
    {
      id: 3,
      name: '–ú–∞—Ä–∏—è',
      role: 'UX/UI –¥–∏–∑–∞–π–Ω–µ—Ä',
      quote: '–ü–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å –Ω–µ –¥–æ–ª–∂–µ–Ω –¥—É–º–∞—Ç—å ‚Äî –∏–Ω—Ç–µ—Ä—Ñ–µ–π—Å –¥–æ–ª–∂–µ–Ω –±—ã—Ç—å –∏–Ω—Ç—É–∏—Ç–∏–≤–Ω—ã–º',
      avatar: 'üë©‚Äçüíº'
    },
    {
      id: 4,
      name: '–ê–ª–µ–∫—Å–µ–π',
      role: '–§—Ä–æ–Ω—Ç–µ–Ω–¥-—Ä–∞–∑—Ä–∞–±–æ—Ç—á–∏–∫',
      quote: '–ö–∞–∂–¥–∞—è –∞–Ω–∏–º–∞—Ü–∏—è –¥–æ–ª–∂–Ω–∞ –Ω–µ—Å—Ç–∏ —Å–º—ã—Å–ª –∏ —É–ª—É—á—à–∞—Ç—å –æ–ø—ã—Ç',
      avatar: 'üë®‚Äçüîß'
    },
    {
      id: 5,
      name: '–î–º–∏—Ç—Ä–∏–π',
      role: '–ú–∞—Ä–∫–µ—Ç–æ–ª–æ–≥',
      quote: '–•–æ—Ä–æ—à–∏–π —Å–∞–π—Ç ‚Äî —ç—Ç–æ —Ç–æ—Ç, –∫–æ—Ç–æ—Ä—ã–π –ø—Ä–∏–Ω–æ—Å–∏—Ç –∫–ª–∏–µ–Ω—Ç–∞–º —Ä–µ–∑—É–ª—å—Ç–∞—Ç',
      avatar: 'üë®‚Äçüìä'
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0 }
  };

  return (
    <TeamSection>
      <Container>
        <SectionHeader>
          <Title
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
          >
            –ö–æ–º–∞–Ω–¥–∞ CORE
          </Title>
        </SectionHeader>

        <TeamGrid
          as={motion.div}
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
        >
          {teamMembers.map((member) => (
            <TeamCard
              key={member.id}
              variants={itemVariants}
              whileHover={{ scale: 1.02 }}
            >
              <TeamPhoto>{member.avatar}</TeamPhoto>
              <TeamName>{member.name}</TeamName>
              <TeamRole>{member.role}</TeamRole>
              <TeamQuote>{member.quote}</TeamQuote>
            </TeamCard>
          ))}
        </TeamGrid>
      </Container>
    </TeamSection>
  );
};

export default Team;
